import React, { Component } from 'react';

export default class Home extends Component {
  render() {
    return (
      <div id='home'>
          <h3>
            Welcome to HiberSense Dashboard. Here you can monitor your room temperature, energy cost
          </h3>
        <button href='/summary'>Get Started</button>
      </div>
    )
  }
}
